import React from "react";
import DamageDefectFormV2 from "./DamageDefectForm/DamageDefectFormV2";
import { CustomerInfo } from './DamageDefectForm/CustomerInfo'
import { ProductInfo } from './DamageDefectForm/ProductInfo'
import Col from 'react-bootstrap/Col'

const FormContainer = () => {
  return (
    <div style={{ width: "100%", display: "flex", overflow: "scroll", margin:30, justifyContent:"center"}}>
      <Col>
        <DamageDefectFormV2 />
      </Col>
      <Col height="100%">
        <ProductInfo />
        <CustomerInfo />
      </Col>

    </div>
  );
};

export default FormContainer;
